import { Link, Route, Routes } from "react-router-dom"; //BrowserRouter isn't required because it exists in index.js
import HomePage from "../uniComponents/Home";
import ViewAppointment from "../uniComponents/ViewAppointment";
import Header from "../uniComponents/Header";
import Footer from "../uniComponents/Footer";
import Login from "../uniComponents/Login";
import Registration from "./Registration";
import CreateAppointment from "../uniComponents/CreateAppointment";
import UserButton from "../uniComponents/choiceComponents/UserButton";
import ViewMedRecord from "./ViewMedRecord";
import PatientRecords from "../uniComponents/PatientRecords";
import UserChoice from "../uniComponents/choiceComponents/UserChoice";
import { useState } from "react";

const patNavData = {
  headerLinks: ["/", "/viewMed", "/reg", "/viewApp", "/createApp"], //This array contains the paths to elements
  headerLabels: [
    "Home",
    "View Medical Record",
    "Registration",
    "View and Cancel Appointments",
    "Create Appointment",
  ],
  headerRoutes: [
    <HomePage />,
    <ViewMedRecord />,
    <Registration />,
    <ViewAppointment />,
    <CreateAppointment />,
  ],
};

export default patNavData;
